//0-1
PolarPosition abs_apol(XYPosition abs_pos)
{
	double dy = abs_pos.y - info.self.xy_pos.y;
	double dx = abs_pos.x - info.self.xy_pos.x;
	double angle;

	if (dx) angle = 180 * atan(dy / dx) / pi;
	else if (dy > 0) angle = 90;
	else if (dy < 0) angle = 270;

	if (dy <= 0 && dx < 0) angle += 180;
	if (dy < 0 && dx > 0) angle += 360;
	if (dy > 0 && dx < 0) angle += 180;

	double distance = sqrt(dx * dx + dy * dy);
	return { distance,angle };
}
//x0
PolarPosition abs_pol(XYPosition abs_pos)
{
	double dy = abs_pos.y - info.self.xy_pos.y;
	double dx = abs_pos.x - info.self.xy_pos.x;
	double angle;

	if (dx) angle = 180 * atan(dy / dx) / pi;
	else if (dy > 0) angle = 90;
	else if (dy < 0) angle = 270;

	if (dy <= 0 && dx < 0) angle += 180;
	if (dy < 0 && dx > 0) angle += 360;
	if (dy > 0 && dx < 0) angle += 180;

	double dangle = angle - info.self.view_angle;

	if (dangle < 0) dangle += 360;

	double distance = sqrt(dx * dx + dy * dy);
	return { distance,dangle };
}
//
XYPosition apol_abs(PolarPosition pol_pos)
{
	double dy = pol_pos.distance*sin(pol_pos.angle*pi / 180);
	double dx = pol_pos.distance*cos(pol_pos.angle*pi / 180);
	return { info.self.xy_pos.x + dx,info.self.xy_pos.y + dy };
}
//
XYPosition pol_abs(PolarPosition pol_pos)
{
	double angle = info.self.view_angle + pol_pos.angle;
	double dy = pol_pos.distance*sin(angle*pi / 180);
	double dx = pol_pos.distance*cos(angle*pi / 180);
	return { info.self.xy_pos.x + dx,info.self.xy_pos.y + dy };
}
