bool move_pickup(int target_ID, XYPosition abs_pos, int	parameter = -1)
{
	if (abs_pol(abs_pos).distance < 1) { pickup(target_ID, parameter); return 1; }
	else { block_move(abs_pos); return 0; }
}
//
void view_pickup()
{
	int flag;
	if (!info.items.empty())
		for (int i = 0; i < info.items.size(); i++)
		{
			flag = 0;
			if (info.items[i].polar_pos.distance < 1) { pickup(info.items[i].item_ID, -1); flag = 1; break; }
		}
	if (!flag)
	{
		double minidistance = info.items[0].polar_pos.distance;
		for (int i = 0; i < info.items.size(); i++)
		{
			if (info.items[i].polar_pos.distance < minidistance) { flag = i; minidistance = info.items[0].polar_pos.distance; }
		}
		block_move(pol_abs(info.items[flag].polar_pos));
	}
}
