const float dpf[10] = { 5,6.25,25,10,20,40,12.5,15,10,5 };
//
bool shoot_dpf(XYPosition abs_pos)//
{
	PolarPosition pol_pos = abs_pol(abs_pos);
	int i, j = -1;
	float max_dpf = 0;
	for (i = 0; i <= 9; i++)
	{
		int k;
		for (k = 0; k < info.self.bag.size(); k++) if (info.self.bag[k].type == i) break;
		if (dpf[i] > max_dpf && ITEM_DATA[i].range >= pol_pos.distance && info.self.bag[k].durability > 0) { max_dpf = dpf[i]; j = i; }
	}
	if (shoot_block(abs_pos) <= 0.25 || j == -1) { std::cout << "" << std::endl; return 0; }
	else { shoot((ITEM)j, pol_pos.angle, -1); return 1; }
}
